import React from 'react';
// import './home_Carrouel.css';
import { Carousel } from '3d-react-carousal';
import image1 from '../Assests/event_banner_1.jpg';
import image2 from '../Assests/event_banner_2.jpg';
import image3 from '../Assests/event_banner_3.jpg';
import image4 from '../Assests/event_banner_1.jpg';
import image5 from '../Assests/event_banner_2.jpg';

import leftArrow from './left-arrow.png';
import rightArrow from './right-arrow.png';



const CoreComments = () => {

  let slides = [
    {
      image: image1,
      width: '10px',
    },
    {
      image: image2,
      width: '100px',
    },
    {
      image: image3,
      
      width: '100px',
    },
    {
      image: image4,

      width: '100px',
    },
    {
      image: image5,
      // title: 'Goodwin Matthews',
      // subtitle: 'Mathematics, Grade 10',
      // paragraph: 'Proin id commodo leo. Aenean ultrices vestibulum est, ac sollicitudin nisl consequat sed.',
      width: '100px',
    },
  ];


  return (

    <div className='carouselcards'>
    <h1>Ask from the best of the CORE, </h1> <h1>  in this term.</h1>
        <div className="previousbtn">
        <img src={leftArrow} width={20} alt='arrow' />
        </div>

        <div className="nextbtn">
        <img src={rightArrow} width={20} alt='arrow' />
        </div>
    
    <Carousel
        slides={slides.map((slide, index) => (
          <div key={index}>
            <div className="slide-content">
              <img src={slide.image} alt={`Slide ${index + 1}`} />
              <div className="slide-para">
                <p>{slide.paragraph}</p>
                <h3>{slide.title}</h3>
                <span>{slide.subtitle}</span>
              </div>
            </div>
          </div>
        ))}
        autoplay={false}
        interval={9000}
      />
      </div>
  );
};

export default CoreComments;
